import React, { useEffect, useState } from 'react';
import {Line} from 'react-chartjs-2'
import GetData from './GetData';




const CovidChart = () => {
    return ( 
       <div>
           <button>1W</button>
           <button>1M</button>
           <button>3M</button>
        <Line
          data={{
            labels: GetData().labels,
            datasets: [
              {
                label: "NSW",
                data: GetData().nswCases,
                fill: false,
                borderColor: "#36a2eb",
                tension: 0.1,
              },
              {
                label: "Vic",
                data: GetData().vicCases,
                fill: false,
                borderColor: "#ff6384",
                tension: 0.1,
              }
            ],
          }}
        />
      </div>
    );
}

export default CovidChart;
